# see: https://math.stackexchange.com/q/4213424

from collections import Counter
from functools import cache, reduce
from math import gcd

MOD = int(1e9 + 7)

def prod(*v: int) -> int:
    return reduce(lambda x, y: x * y % MOD, v, 1)


@cache
def factorial(n: int) -> int:
    # there exist faster solutions for large n,
    # but we do not expect n to exceed 10^4 in all test cases
    # see: https://stackoverflow.com/a/9728561
    return prod(*range(1, n + 1))


def modinv(n: int) -> int:
    # computes the multiplicative modular inverse of n;
    # a / n (mod m) = a * n^-1 (mod m)
    return pow(n, -1, MOD)


def phi(n: int) -> int:
    # Euler's totient function
    return sum(gcd(x, n) == 1 for x in range(1, n + 1))


def multinomial(n: int, v: list[int], d: int) -> int:
    denom = prod(*(factorial(r // d) for r in v))
    return (factorial(n // d) * modinv(denom)) % MOD


def polya(n: int, v: list[int]) -> int:
    # Polya's enumeration theorem
    g = gcd(*v)
    res = sum(
        (phi(d) * multinomial(n, v, d)) % MOD
        for d in range(1, g + 1)
        if g % d == 0
    ) % MOD
    return (res * modinv(n)) % MOD


if __name__ == "__main__":
    n = int(input())
    v = Counter([input() for _ in range(n)]).values()
    print(polya(n, list(v)))
